#pragma pack(push, 1)
typedef struct ethernet_header {
    u_char dst_mac[6];
    u_char src_mac[6];
    u_short type;
} ethernet_header_t;

typedef struct arp_header {
    u_short htype;
    u_short ptype;
    u_char hlen;
    u_char plen;
    u_short oper;
    u_char sha[6];
    u_char spa[4];
    u_char tha[6];
    u_char tpa[4];
} arp_header_t;
#pragma pack(pop)

